GBF-TARGET-15Description:
Njupuk langkah legal, administratif utawa kabijakan kanggo nyengkuyung lan ngaktifake bisnis, lan utamane kanggo mesthekake yen perusahaan gedhe lan transnasional lan institusi keuangan: 

(a) Ajeg ngawasi, netepake, lan mbukak kanthi transparan risiko, ketergantungan lan pengaruhe marang keanekaragaman hayati, kalebu syarat kanggo kabeh perusahaan gedhe lan transnasional lan institusi keuangan ing sadawane operasi, rantai pasokan lan nilai lan portofolio;

(b) Nyedhiyakake informasi sing dibutuhake kanggo konsumen kanggo ningkatake pola konsumsi sing lestari; 

(c) Laporan babagan kepatuhan karo peraturan lan langkah-langkah akses lan enggo bareng keuntungan, kaya sing ditrapake;

supaya bisa nyuda dampak negatif ing keanekaragaman hayati kanthi progresif, nambah dampak positif, nyuda risiko sing ana hubungane karo keanekaragaman hayati marang institusi bisnis lan finansial, lan ningkatake tumindak kanggo njamin pola produksi sing lestari.

GBF-TARGET-19Description:
Tambah sacara substansial lan progresif tingkat sumber daya finansial saka kabeh sumber, kanthi cara sing efektif, pas wektune lan gampang diakses, kalebu sumber daya domestik, internasional, umum lan pribadi, selaras karo Artikel 20 Konvensi, kanggo ngetrapake strategi lan rencana aksi keanekaragaman hayati nasional. , ing 2030 mobilizing paling ora 200 milyar dolar Amerika Serikat saben taun, kalebu dening:

(a) Nambah total sumber daya finansial internasional sing gegandhengan karo keanekaragaman hayati saka negara maju, kalebu bantuan pembangunan resmi, lan saka negara sing kanthi sukarela nanggung kewajiban negara maju, menyang negara berkembang, utamane negara paling maju lan negara berkembang pulo cilik, uga negara-negara kanthi ekonomi ing transisi, paling sethithik US$ 20 milyar saben taun ing taun 2025, lan paling sethithik US$ 30 milyar saben taun ing taun 2030;

(b) Nambah mobilisasi sumber daya domestik kanthi signifikan, difasilitasi kanthi nyiapake lan implementasi rencana keuangan keanekaragaman hayati nasional utawa instrumen sing padha miturut kabutuhan, prioritas lan kahanan nasional;

(c) Ngapikake keuangan pribadi, promosi keuangan campuran, ngetrapake strategi kanggo nambah sumber daya anyar lan tambahan, lan nyengkuyung sektor swasta kanggo nandur modal ing keanekaragaman hayati, kalebu liwat dana dampak lan instrumen liyane;

(d) Skema inovatif sing ngrangsang kayata pembayaran kanggo layanan ekosistem, obligasi ijo, imbangan lan kridit keanekaragaman hayati, mekanisme pembagian keuntungan, kanthi pengamanan lingkungan lan sosial;

(e) Ngoptimalake keuntungan bebarengan lan sinergi keuangan sing ngarahake krisis keanekaragaman hayati lan iklim;

(f) Ningkatake peran tumindak kolektif, kalebu dening masyarakat pribumi lan komunitas lokal, tumindak ibu Pertiwi [1] lan pendekatan non-pasar kalebu manajemen sumber daya alam berbasis komunitas lan kerjasama lan solidaritas masyarakat sipil sing dituju kanggo konservasi keanekaragaman hayati ;

(g) Ningkatake efektifitas, efisiensi lan transparansi panyedhiya lan panggunaan sumber daya.

***

[1] Tumindak Ibu Bumi-sentris: Pendekatan ekosentris lan adhedhasar hak-hak sing ngidini implementasine tumindak menyang hubungan harmonis lan komplementer antarane manungsa lan alam, ningkatake kesinambungan kabeh makhluk urip lan komunitase lan njamin non-komodifikasi fungsi lingkungan. Ibu Bumi.
